import React from 'react';
import Header from '../../Components/Header';
import Slider_One from '../../Components/Slider';
import Home_About from '../../Components/About';
import Popular_Dishes from '../../Components/Popular_Dishes';
import Food_Menu from '../../Components/Food_Menu';
import Gallery from '../../Components/Gallery';
const Wrapper=(props)=>{
    return(
        <div className="wrapper white-bg">
            <Header/>
            <Slider_One/>
            <Home_About/>
            <Popular_Dishes/>
            <Food_Menu/>
            <Gallery/>
        </div>
    )
}
export default Wrapper;
